import React from 'react';

const Hero = () => {
  return (
    <section className="hero" id="home">
      <div className="hero-content">
        <h1>Hi, I'm <span>EPIC CODERS</span></h1>
        <h2>Code Experts</h2>
        <p>I build amazing web experiences</p>
        <a href="#contact" className="btn">Get In Touch</a>
      </div>
    </section>
  );
};

export default Hero;
